@katherin_todd Bueno... yo usé un traje parecido al de ella cuando perteneció al escuadron suicida, pero como dije, seguir el legado de un payaso es patetico, prefiero crear mi propio legado. Y estoy lograndolo como Red Death...

-Observó la risa de su hermanita.-

¿Que hiciste Katherin?
